Let's denote the number as $x$. We then have two equations:

\begin{align*}
x + 100 &= a^2 \\
x + 168 &= b^2
\end{align*}

for some integers $a$ and $b$. Subtracting the first equation from the second gives us:

$$48 = b^2 - a^2$$

We now notice that 48 is the square of 7, so we can let $b^2 - a^2 = 7^2$. This means $b^2 = 14^2$ and $a^2 = 13^2$. Solving for $b$ and $a$, we get $b = 14$ and $a = 13$.

Going back to the first equation, we now have $x + 100 = 13^2$, which means $x = \boxed{99}$.

