Solution: When dividing a dividend by a divisor, if the dividend is increased by 10 times and the divisor is decreased by 100 times, the quotient will be increased by (10×100) times;  
$10×100=1000$;  
$0.514×1000=514$.  
Therefore, the answer is $\boxed{514}$.  
The rule of change for the quotient is as follows: if the dividend remains unchanged and the divisor is increased (or decreased) by a certain factor (excluding zero), then the quotient will decrease (or increase) by the same factor; if the divisor remains unchanged and the dividend is increased or decreased by a certain factor (excluding zero), then the quotient will also increase (or decrease) by the same factor. This rule is key to solving the problem.  
Understanding the invariance of the quotient and the rule of its change is crucial to solving this problem.

