We are given that $\overrightarrow{a} \parallel 3\overrightarrow{b}$. This means that $\frac{\overrightarrow{a}}{3} = \overrightarrow{b}$, which we can rewrite as:
$$
\overrightarrow{b} = \frac{1}{3}\overrightarrow{a}
$$
We can sum this up in components as:
$$
\begin{aligned}
b_1 &= \frac{1}{3} a_1 \\
b_2 &= \frac{1}{3} a_2
\end{aligned}
$$
We have that $\overrightarrow{b} = (m, m-1)$ and $\overrightarrow{a} = (2,1)$, so we get the following two equations:
$$
\begin{aligned}
m &= \frac{2}{3} \\
m-1 &= \frac{1}{3}
\end{aligned}
$$
Adding these equations gives $2m = \frac{3}{3} \implies m = \boxed{\frac{1}{2}}$. The answer is \frac{1}{2}

